    function navigation() {
      if ($.fn.onePageNav && $("#nav").length) {
        $('#nav').onePageNav({
          currentClass: 'active',
          scrollSpeed: 600,
          scrollOffset: 60,
          scrollThreshold: 0.2,
          easing: 'swing'
        })
      }
    }
    // Date countdown plugin for jQuery
    function countdown() {
      var count = $('#countdown');
      if ($.fn.countdown && count.length) {
        count.countdown(count.data("date"), function (event) {
          var $this = $(this);
          switch (event.type) {
          case "seconds":
          case "minutes":
          case "hours":
          case "days":
          case "weeks":
          case "daysLeft":
            $this.find('p#' + event.type).html(event.value);
            break;
          case "finished":
            $this.hide();
            break;
          }
        });
      }
    }
